import React from 'react';
import './Button.css';
import {Link} from "react-router-dom";

const Button = ({ type, text, path }) => {
    const className = type === 'dark' ? 'dark' : 'light';

    return (
        <Link to={path}>
        <button className={className}>
            {text}
        </button>
        </Link>
    );
};

export default Button;
